import React from 'react';
import Link from "next/link";
import './Navigation.scss';
const Navigation = () => {
    return (
        <div className='Navigation'>
            <Link href='/auth/login'><a>ورود</a></Link>
            <Link href='/auth/register'><a>ثبت نام</a></Link>
        </div>
    );
};

export default Navigation;
